import React from "react";

const Card = (props) => {
  return (
    <div>
      <div className="container">
        <div className="id"></div>
        <div className="contents">
          <div className="contents-title"></div>
          <div className="contents-text"></div>
          <img src="" alt="이미지 url" className="contents-img"></img>
        </div>
      </div>
    </div>
  );
};

export default Card;
